import React from 'react';
import styled from "styled-components";

const ContentBlock = styled.div`
    background-color: gray;
`;



const Content = () => {
    return (
        <>
        <ContentBlock>
        안녕하세요
        </ContentBlock>
        
        
        </>
    );
};

export default Content;
